This layer contains aspatial details for all properties in Victoria. A property is defined as land, usually contiguous, under one ownership, and of a common class and tenure. It is used for land under common occupation particularly for the purpose of rating, billing or habitation. Properties are typically described by street address allocated by an authority such as local government.

This dataset s a raw superset of VMPROP_PROPERTY.  It shows the current and retired state of each feature instance.  It  supports feature versioning (UFI_RETIRED) and enables feature edting chaining (UFI_OLD).

It includes:
- Property numbers as allocated by local governement authority;
- Registered and proposed status;
- Type of property, ie, single or multi-assessment;
- LGA code;
- Unique Feature Identifiers, date stamps and data quality information.
- Address

Proportionof the Australian Economic Zone experiencing record high sea surface temperatures 1981-2016. Includes three month running mean. Extreme SSTs calculated by comparing monthly SSTs with all other recorded monthly SSTs in the time series at a particular grid point. If the SST was higher than all other SSTs recorded for that grid point during that month, it was considered an extreme event.were Data used to re-create graph Figure MAR6 in Marine chapter of the 2016 State of the Environment Report. See;
https://soe.environment.gov.au/theme/marine-environment/topic/2016/climate-change#marine-environment-figure-6

Data derived by CSIRO - metadata also at http://catalogue.aodn.org.au/geonetwork/srv/eng/metadata.show?uuid=cca8c5ce-4b21-406d-b20c-7b333f8e605c

The effect of climate change on the study area was investigated for the 1% AEP design and PMF events. The following scenarios were modelled:
- 1% AEP design storm event plus 0.9 m sea level rise;
-  1% AEP design storm event with a 10% increase in rainfall plus 0.9 m sea level rise;
-  1% AEP design storm event with a 30% increase in rainfall plus 0.9 m sea level rise;
-  PMF storm event plus 0.9 m sea level rise;
- PMF storm event with a 10% increase in rainfall plus 0.9 m sea level rise;
- PMF storm event with a 30% increase in rainfall plus 0.9 m sea level rise.
Depth and velocity mapping for both the 1% AEP and PMF events with a 30% increase in rainfall plus 0.9 m sea level rise are included as Figure D1 to Figure D4.

Based on graph in "Orange roughy (Hoplostethus atlanticus) eastern zone stock assessment incorporating data up to 2014. Report to the Australian Fisheries Management Authority. CSIRO, Hobart". Data provided by AFMA / CSIRO, for more information see http://www.afma.gov.au/wp-content/uploads/2014/03/SESSF-CSIRO-Orange-Roughy-Eastern-Assessment-Final-2014.pdf

